 import React, {useState} from 'react';
 import {View, Text, Button, TextInput} from "react-native";


 const App = () => {

  const [count, setCount] = useState(56);
  const [name, setName] = useState("");



  const addCount = () => {
    setCount(count + 1)
  }
  const minusCount = () => {
    setCount(count - 1)
  }

  const changeName = () => {
    setName("p1")
  }
   return (

    <View>
      <View>
      <Text> {count}  </Text>
      <Button title="Plus" onPress={addCount}/>
      <Button title="Minus" onPress={minusCount}/>
      </View>
      <View>
        <Text>My name is {name}</Text>
        <TextInput onC />
        <Button title="ChangeName" onPress={changeName}/>

      </View>
    </View>

   );
 };

 export default App;
